import { View, Text, SafeAreaView } from "react-native";
import React, { useLayoutEffect } from "react";
import { useNavigation } from "@react-navigation/native";

const HomeScreen = () => {
  const navigation = useNavigation();

  useLayoutEffect(() => {
    navigation.setOptions({
      headerShown: false,
    });
  }, []);

  return (
    <SafeAreaView>
      <Text className="">
        <View>
          {/*  logo */}
          {/* <Image
            source={{
              uri: "https://cdn2.vectorstock.com/i/1000x1000/19/96/food-delivery-app-line-icon-contactless-meal-vector-34881996.jpg",
            }}
            className=""
          /> */}
          <View className="container bg-pink-600">
            <Text>hello hello</Text>
            <Text>hello hello</Text>
          </View>
        </View>
      </Text>
    </SafeAreaView>
  );
};

export default HomeScreen;
